import React, { Component } from 'react';

class LinkData extends Component {

  componentDidMount() {
    fetch('/api/customers')
      .then(res => res.json())
      .then(customers => this.setState({customers}, () => console.log('Customers fetched...', customers)));
  }

}

export default LinkData;
// 
export const linkData = [
    {
        id:1,
        text:'home',
